import React from "react";
import BackToTop from "../backToTop/BackToTop";
import {
  BrowserRouter,
  Route,
  Switch,
  useRouteMatch,
  Link,
} from "react-router-dom";
import Page1 from "./ContactChild/Page1";
import Page2 from "./ContactChild/Page2";
import Page3 from "./ContactChild/Page3";

export default function Contact() {
  const match = useRouteMatch();
  console.log({ match });
  return (
    <>
      <BackToTop />
      <BrowserRouter>
        <ul>
          <li>
            <Link to="/contact/page1">page1</Link>
          </li>
          <li>
            <Link to="/contact/page2">page2</Link>
          </li>
          <li>
            <Link to="/contact/page3">page3</Link>
          </li>
        </ul>
        <Switch>
          <Route exact path={`${match.url}/page1`} component={Page1} />
          <Route path={`${match.url}/page2`} component={Page2} />
          <Route path={`${match.url}/page3`} component={Page3} />
          <Route component={<h1>NOT FOUND!</h1>} />
        </Switch>
      </BrowserRouter>
    </>
  );
}
